The Bridge to Nowhere (2009) NTSC

Plot: 
The Bridge to Nowhere is the story of four young 20-something men from the rough Upper North Side of Pittsburgh. They are stuck in dead-end jobs and struggle with dysfunctional family lives. The guys, inspired by the images of pop culture and the desire to break away from the neighborhood, regularly scheme to make extra money by running minor underground activities, including: sports booking, poker tournaments and house parties. One night during an evening out the four young men stumble across the &quot;new neighbors&quot;, two independent prostitutes, Jasper and Candice, who end up inspiring a new business idea. Trapped in her own existence, Jasper, agrees to join forces with the young men to create, quite accidentally, what turns out to be an empire that launches each of them into financial riches. Along the way each character battles their own demons regarding the choices they have made In the end, however, their world comes crashing down on them in grandiose fashion. It's the city of bridges, where water separates the haves and have-nots, the bridge they sought so desperately to cross ultimately ends up being The Bridge To Nowhere



